// export default Header;
import React from "react";
// import "./MehreenStyles.css"
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Header() {
    return (
        <div>
        <Navbar className="nav-link" expand="lg">
      
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">  {/* for the left side of navbar*/}
              <li class="nav-item active">
              <a class="nav-link" href="#" style={{background: "#955F61",color: "white"}}>Menu</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#" style={{background: "#955F61",color: "white"}}>Services</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#" style={{background: "#955F61",color: "white"}}>About Us</a>
            </li>
              </Nav>
             <Nav className="ml-auto">  {/* for the right side of navbar*/}
              <li class="nav-item active">
              <a class="nav-link" href="#" style={{background: "#955F61",color: "white",marginTop:"10px"}}>Contact Us</a>
            </li>
            <li class="nav-item active">
              <a class="nav-link" href="#" style={{background: "#955F61",color: "white",marginTop:"10px"}}>Login</a>
            </li>
            <li class = "nav-item">
              <button class="btn"><i class="fa fa-search" style={{background: "#955F61",color: "white",marginTop: "10px"}}></i></button>
            </li>
            <li class="nav-item">
              <a href="#" class="fa fa-facebook" style={{background: "#955F61",color: "white",marginTop: "20px"}}></a>
            </li>
            <li class="nav-item">
              <a href="#" class="fa fa-instagram" style={{background: "#955F61",color: "white",marginTop: "30px"}}></a>
            </li>
    
            </Nav>
            
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
}

export default Header;



